import React, { useEffect, useState } from 'react'
import './index.css'

const App = () => {
  const [count, setcount] = useState(0)



  return (
    <div className='app'>
      <h1
      onClick={()=> setcount(count + 1)}
        className='heading'>
        Increase Number
      </h1>
      <h1
        className='heading'>
        {count}
      </h1>

    </div>
  )
}

export default App
